import React from 'react';
import { Tab, Tabs, Container} from 'react-bootstrap';

const HeaderSchedule = () => {

	return (
		<>
		<Container>
			<Tabs defaultActiveKey="내 스케줄" id="uncontrolled-tab-example" className="mb-3">
				<Tab eventKey="내 스케줄" title="Home">
					hi
				</Tab>
				<Tab eventKey="구성원 스케줄" title="Profile">
					hi
				</Tab>

			</Tabs>
			</Container>
		</>
	);
}

export default HeaderSchedule;
